import React from 'react';
import styled from '@emotion/styled';

const Weather = styled("div")` 
display: flex;
height: 100%;
flex-direction: row;
flex-wrap: wrap;
justify-content: space-around;
align-content: center;
background: #fff;
box-shadow: 0 3px 6px rgba(0, 0, 0, 0.16);
`

export const WindChart = () => {
  return (
    <div>
      WindChart
    </div>
  )
}
